import './App.css';
import LoginPage from './views/login/components/LoginPage'
import HomePage from './views/dashboard/components/HomePage'

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return (
      <Router>
      <Switch>
        <Route path="/home-page">
          <HomePage />
        </Route>
        <Route path="/">
          <LoginPage />
        </Route>
      </Switch>
      </Router>
        );

}

export default App;
